const bg1 = require("../images/bg_1.jpg")
const bg2 = require("../images/bg_2.jpg")
const bg3 = require("../images/bg_3.jpg")

const sliderBanner = [
    {
        sourceUrl: bg1,
        title: 'We serve Fresh Vegestables & Fruits',
        subtitle: 'We deliver organic vegetables & fruits',
        slug: 'slug-category',
        path: 'shop/slug-category'
    },
    {
        sourceUrl: bg2,
        title: '100% Fresh & Organic Foods',
        subtitle: 'We deliver organic vegetables & fruits',
        slug: 'slug-category2',
        path: 'shop/slug-category2'
    },
    {
        sourceUrl: bg3,
        title: 'We serve Fresh Vegestables & Fruits',
        subtitle: 'We deliver organic vegetables & fruits',
        slug: 'slug-category3',
        path: 'shop/slug-category3'
    }
]

export default sliderBanner
